import React from 'react';

const Dashboard: React.FC = () => {
    return (
        <div className="dashboard">
            <h1>Health Insights Dashboard</h1>
            <p>Welcome to the Azure AI Health Insights demo application.</p>
            <p>Use the navigation to explore different sections of the app.</p>
        </div>
    );
};

export default Dashboard;
